import React from "react";
import Tracklist from "../Tracklist/Tracklist";

function Playlist(props){
    const title = props.title ? props.title : "Sample Playlist title";

    function updateTitle(e){
        props.updateTitle(e.target.value);
    }

    return (
        <div className="playlist">
            <input type="text" value="Enter a playlist name" onChange={updateTitle} />
            <Tracklist tracks={props.tracks} onAddTrack={props.onAddTrack} onRemoveTrack={props.onRemoveTrack} added={true} />
        </div>
    );
}

export default Playlist;
